import React from "react";
import { Container, Jumbotron, Row, Col } from "react-bootstrap";

function Hero() {
  return (
    <Jumbotron>
      <Container>
        <Row>
          <Col>
            <h2>Allison Barnard</h2>
          </Col>
        </Row>
      </Container>
    </Jumbotron>
  );
}

export default Hero;
